import React from 'react';
import { Doughnut } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, ArcElement } from 'chart.js';

ChartJS.register(CategoryScale, ArcElement);

export default function DoughnutPair({ leftData, rightData }) {
  const baseOpt = { plugins: { legend: { display: false } } };
  return (
    <div className="d-flex justify-content-center gap-5 flex-wrap">
      <div style={{ width: 220 }}>
        <Doughnut data={leftData} options={baseOpt} />
      </div>
      <div style={{ width: 220 }}>
        <Doughnut data={rightData} options={baseOpt} />
      </div>
    </div>
  );
}
